import React from 'react'
import axios from 'axios';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import './Images.css';
import { useState } from 'react';
import {IndivisiualImage} from './IndivisiualImage';
export const Images = () => {

   const [images, setImages] = useState([]);

    const fetchAPI = async()=>{
    const response = await axios.get('https://api.unsplash.com/photos/?client_id=YbnWcUQHyapMRVl5x8yCOn_I9inhl0dTOpCfNjy99no');
    const data = response.data;
    setImages(data);
    }
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 3
    };
  return (
    <div>
        <button onClick={fetchAPI}>See Photos</button>
        <Slider {...settings}>
        <div className='Images'>
            <IndivisiualImage images={images}></IndivisiualImage>
        </div>
        </Slider>
    </div>
  )
}
